import React from "react";

export const HeroTable: React.FC = () => {
  return (
    <div className="hero-table">
      <div className="hero-table-element">Coding</div>
      <div className="hero-table-element">Math</div>
      <div className="hero-table-element">Physics</div>
      <div className="hero-table-element">Chemistry</div>
    </div>
  );
};
